import React, { Component } from 'react';
import { ImageBackground, StyleSheet, Text, View } from 'react-native';



export default class Login extends Component{


    constructor(props){
        super(props)
        this.state={
            email:'',
            password:''

        }
    }


    render(){
        return(
            <View style={{flex:1,
                backgroundColor:'#f52a4c',  
               alignItems: 'center',
                justifyContent: 'center',
                alignContent:"center" }}>
                   <LinearGradient
                colors={['rgba(0.7,0.5,0.2,0.8)', 'transparent']}
                style={styles.background}
              />
                <Text style={{fontSize:32,alignContent:'center',alignSelf:'center',alignItems:'center'}}>Welcome to Login Screen</Text>
            </View>
        );

    }
}
